                </p>
                <div className="flex gap-4 mt-2 text-xs text-muted-foreground">
                  <span>ðŸ¢ Slower process</span>
                  <span>ðŸŽ¯ Captures JS-rendered content</span>
                  <span>âš ï¸ Requires browser</span>
                </div>
              </div>
            </div>
          </RadioGroup>
        </div>

        <DialogFooter>
          <Button variant="outline" onClick={onClose} data-testid="button-cancel-settings">
