.TUXToastProvider-topOutlet {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  display: flex;
  flex-direction: column-reverse;
  padding-top: 4px;
  align-items: center;
  pointer-events: none;
}

.TUXToastProvider-topOutlet > * + * {
  margin-bottom: 4px;
}

.TUXToastProvider-bottomOutletContainer {
  position: fixed;
  bottom: 0;
  left: 0;
  right: 0;
  pointer-events: none;
}

.TUXToastProvider-bottomOutlet {
  display: flex;
  flex-direction: column;
  padding-bottom: 4px;
  align-items: center;
  pointer-events: none;
}

.TUXToastProvider-bottomOutlet > * + * {
  margin-top: 4px;
}

.TUXToastProvider-noticeOutlet {
  display: flex;
  flex-direction: column;
  padding-bottom: 4px;
  align-items: center;
  pointer-events: none;
}

.TUXToastProvider-noticeOutlet > * + * {
  margin-top: 4px;
}

.TUXToastProvider-center-outlet {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;

  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;

  pointer-events: none;
}

.TUXToast {
  display: flex;
  justify-content: center;
  transition: opacity 0.2s ease-out;
  opacity: 1;
  pointer-events: auto;
}

.TUXToast--top--entered {
  animation: TUXToast-top-enter 0.2s ease-in;
}

.TUXToast--top--exiting {
  opacity: 0;
}

.TUXToast--bottom--entered {
  animation: TUXToast-bottom-enter 0.2s ease-in;
}

.TUXToast--bottom--exiting {
  opacity: 0;
}

.TUXToast--center--entered {
  animation: TUXToast-center-enter 0.2s linear;
}

.TUXToast--center--exiting {
  animation: TUXToast-center-exit 0.2s linear;
}

@keyframes TUXToast-top-enter {
  from {
    opacity: 0;
    transform: translateY(-100%);
  }
  to {
    opacity: 1;
    transform: translateY(0%);
  }
}

@keyframes TUXToast-bottom-enter {
  from {
    opacity: 0;
    transform: translateY(+100%);
  }
  to {
    opacity: 1;
    transform: translateY(0%);
  }
}

@keyframes TUXToast-center-enter {
  from {
    opacity: 0;
    scale: 0.8;
  }
  to {
    opacity: 1;
    scale: 1;
  }
}

@keyframes TUXToast-center-exit {
  from {
    opacity: 1;
    scale: 1;
  }
  to {
    opacity: 0;
    scale: 0.8;
  }
}

